# Analyse de données 'Omics'

## Introduction

## Rappel du cours d'introduction

&lt;img src=&quot;data:image/png;base64,#img/slides-GD/ENSAI_IntroOMICS_p57.png&quot; width=&quot;80%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;

--

### Remarques sur les deux premières étapes:

- fondamentales pour la qualité des données
- il y a des statistiques là aussi !
- importance de la planification d'expérience

---
## Focus de cette partie du cours

Motivation: *questions biologiques et cliniques en cancérologie* (vs GWAS)

### Deux questions statistiques

- analyse différentielle (d'expression de gènes)

&gt; Tests multiples (&quot;class comparison&quot;)

- analyse de données de nombre de copes d'ADN

&gt; Segmentation (&quot;class discovery&quot;)


--

### Des questions classiques en statistique ?

Oui, mais avec des données

- de grande dimension: nombre de variables `\(\gg\)` nombre d'observations
- sparses: peu de signal
- structurées: dépendances/interactions entre gènes


---

## Objectif: trouver un compromis acceptable entre

- aspects statistiques: choix de modélisation, garanties mathématiques

- interprétabilité des résultats

- aspects computationnels/algorithmiques

--

## Questions transverses

- reproductibilité des résultats
- évaluation objective des performances des méthodes

---
